import React from 'react'
import "./orderBuy.css"
import ArrowDownwardIcon from '@material-ui/icons/ArrowDownward';
import { DataGrid } from '@material-ui/data-grid';
import DeleteSharpIcon  from '@material-ui/icons/DeleteSharp';
import ArrowUpwardIcon from '@material-ui/icons/ArrowUpward';



export default function OrderBuy() {
    const columns = [
        { field: 'id', headerName: 'ID', width: 70 },
        { field: 'user', headerName: 'User', width: 200, 
        renderCell: (params) => {
          return(
            <div className="orderBuy">
              {params.row.username}
            </div>
            );
        }
      },
        { field: 'email', headerName: 'email', width: 200 },
        {
          field: 'status',
          headerName: 'Status',
          width: 150,
        },
        {
          field: 'date',
          headerName: 'Date',
          width: 150,
        },
        {
          field: 'coin',
          headerName: 'Coin',
          width: 80,
        },
        {
          field: 'transaction',
          headerName: 'Transaction',
          width: 150,
         },
         {
          field: 'action',
          headerName: 'Action',
          width: 150,
          renderCell: (params) => {
            return(
              <>
                <button className="userListEdit">Edit</button>
                <DeleteSharpIcon className="userListDelete"/>
              </>
              );
          }
         },

      ];

      const rows = [
        { id: 1, username: 'Snow Jon',
         avatar: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRhdHMs1CYPk35Vzum8-LMmuHDADidpZp_SGg&usqp=CAU", 
        email: 'jon@gemial.com', status: 'active', transaction: '$200.000' },
        { id: 2, username: 'Lannister Cersei', avatar: 'img', email: 'cersei@gemial.com', status: 'active', date: '02/02/21', coin: 'BTC', transaction: '$280.000' },
        { id: 3, username: 'Lannister Jaime', avatar: 'img', email: 'jaime@gemial.com', status: 'pending', date: '02/02/21', coin: 'BTC', transaction: '$400.000' },
        { id: 4, username: 'Stark  Arya', avatar: 'img', email: 'arya@gemial.com', status: 'active', date: '07/02/21', coin: 'BNB', transaction: '$150.000' },
        { id: 5, username: 'Targaryen Daenerys', avatar: 'img', email: 'daenery@gemial.com',status: 'pending', date: '02/02/21', coin: 'BTC', transaction: '$160.000' },
        { id: 6, username: 'Melisandre', avatar: 'img', email: 'melisandre@gemial.com', status: 'active', date: '02/03/21', coin: 'BNB', transaction: '$260.000' },
        { id: 7, username: 'Clifford Ferrara', avatar: 'img', email: 'Ferrara@gemial.com', status: 'pending', date: '02/03/21', coin: 'ADA', transaction: '$630.000' },
        { id: 8, username: 'Frances Rossini', avatar: 'img', email: 'Rossisi@gemial.com', status: 'active', date: '02/04/21', coin: 'BTC', transaction: '$275.000' },
        { id: 9, username: 'Roxie Harvey', avatar: 'img', email: 'harvey@gemial.com', status: 'pending', date: '02/04/21', coin: 'ETH', transaction: '$210.000' },
      ];
    return (
        <div className="orderBuy">

                <div className="orderBuyItem">

                <span className="orderBuyTitle">Buy</span>
                <div className="orderBuyMoneyContianer">
                    <span className="orderBuyMoney">$400,340</span>
                    <span className="orderBuyMoneyRate">
                        -$13 <ArrowDownwardIcon className='orderBuyIcon'/>
                        </span>
                </div>
                <span className="orderBuySub">Compared to last 24hrs</span>

                </div>

                <div className="orderBuyTable" style={{ height: 400, width: '100%' }}>
                 <DataGrid rows={rows} columns={columns} pageSize={5} checkboxSelection />
               </div> 

               <div className="oderBuyTotalContianer">
               <div className="orderBuyItem">

                <span className="orderBuyTitle">Total Buy</span>
                <div className="orderBuyMoneyContianer">
                    <span className="orderBuyMoney">$400,340</span>
                    <span className="orderBuyMoneyRate">
                        -131 <ArrowDownwardIcon className='orderBuyIcon'/>
                        </span>
                </div>
                <span className="orderBuySub">Compared to last 24hrs</span>

                </div>
                <div className="orderBuyItem ">

                <span className="orderBuyTitle">Users that bought</span>
                <div className="orderBuyMoneyContianer">
                    <span className="orderBuyMoney">40,340</span>
                    <span className="orderBuyMoneyRate">
                        +213 < ArrowUpwardIcon className='orderBuyIcon up'/>
                        </span>
                </div>
                <span className="orderBuySub">Compared to last 24hrs</span>

                </div>


               </div>

        </div>
    )
}
